class Solution(object):
    def minOperations(self, s1, s2, x):
        """
        :type s1: str
        :type s2: str
        :type x: int
        :rtype: int
        """
        def min_ops(s1, s2, x):
            n = len(s1)
            cost = 0
            i = 0
            while i < n:
                if s1[i] != s2[i]:
                    # If next character is different and x <= 2, flip adjacent
                    if i + 1 < n and s1[i + 1] != s2[i + 1]:
                        cost += 1
                        i += 2
                    else:
                        # If flipping two non-adjacent bits is cheaper or the only option
                        if x <= 2:
                            return -1  # Impossible to match s1 with s2 with given operation costs
                        cost += x
                        i += 1
                else:
                    i += 1
            return cost

        # Calculate the minimum operations required
        min_operations_cost = min_ops(s1, s2, x)
        return min_operations_cost
